--
-- Name: create_admin_session(uuid, text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.create_admin_session(p_user_id uuid, p_email text) RETURNS TABLE(session_token text, expires_at timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    SET search_path TO 'public', 'pg_temp'
    AS $$
DECLARE
  v_session_token TEXT;
  v_expires_at TIMESTAMP WITH TIME ZONE;
  v_active_sessions INTEGER;
BEGIN
  -- Clean up expired sessions first
  PERFORM cleanup_expired_admin_sessions();
  
  -- Check active session limit (max 3)
  SELECT COUNT(*) INTO v_active_sessions 
  FROM admin_sessions 
  WHERE is_active = true;
  
  IF v_active_sessions >= 3 THEN
    RETURN;
  END IF;
  
  -- Generate session token
  v_session_token := encode(gen_random_bytes(32), 'hex');
  v_expires_at := now() + interval '24 hours';
  
  -- Create session
  INSERT INTO admin_sessions (user_id, email, session_token, expires_at)
  VALUES (p_user_id, p_email, v_session_token, v_expires_at);
  
  RETURN QUERY SELECT v_session_token, v_expires_at;
END;
$$;


ALTER FUNCTION public.create_admin_session(p_user_id uuid, p_email text) OWNER TO postgres;

