CREATE FUNCTION public.create_notification(p_user_id uuid, p_source_type text, p_source_id uuid, p_actor_id uuid, p_title text, p_message text, p_link text DEFAULT NULL::text, p_image_url text DEFAULT NULL::text, p_priority text DEFAULT 'normal'::text, p_metadata jsonb DEFAULT '{}'::jsonb) RETURNS uuid
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_id uuid;
BEGIN
    -- Don't notify if actor is the same as user (don't notify yourself)
    IF p_actor_id = p_user_id THEN
        RETURN NULL;
    END IF;

    INSERT INTO public.user_notifications (
        user_id, source_type, source_id, actor_id, 
        title, message, link, image_url, priority, metadata
    )
    VALUES (
        p_user_id, p_source_type, p_source_id, p_actor_id,
        p_title, p_message, p_link, p_image_url, p_priority, p_metadata
    )
    RETURNING id INTO v_id;
    
    RETURN v_id;
END;
$$;


