--
-- Name: get_activity_timeline(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_activity_timeline(days_back integer DEFAULT 30) RETURNS TABLE(activity_date date, new_users bigint, blog_posts bigint, page_views bigint, chat_interactions bigint)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RETURN QUERY
    WITH date_series AS (
        SELECT generate_series(
            CURRENT_DATE - (days_back || ' days')::interval,
            CURRENT_DATE,
            '1 day'::interval
        )::date AS d
    )
    SELECT 
        ds.d AS activity_date,
        COALESCE((SELECT COUNT(*) FROM public.profiles WHERE created_at::date = ds.d), 0) AS new_users,
        COALESCE((SELECT COUNT(*) FROM public.blog_posts WHERE created_at::date = ds.d), 0) AS blog_posts,
        COALESCE((SELECT COUNT(*) FROM public.page_views WHERE created_at::date = ds.d), 0) AS page_views,
        COALESCE((SELECT COUNT(*) FROM public.chat_interactions WHERE created_at::date = ds.d), 0) AS chat_interactions
    FROM date_series ds
    ORDER BY ds.d;
END;
$$;


ALTER FUNCTION public.get_activity_timeline(days_back integer) OWNER TO postgres;

