--
-- Name: match_documents(public.vector, double precision, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.match_documents(query_embedding public.vector, match_threshold double precision, match_count integer) RETURNS TABLE(id uuid, resource_id uuid, content text, metadata jsonb, similarity double precision)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    document_embeddings.id,
    document_embeddings.resource_id,
    document_embeddings.content,
    document_embeddings.metadata,
    1 - (document_embeddings.embedding <=> query_embedding) AS similarity
  FROM document_embeddings
  WHERE 1 - (document_embeddings.embedding <=> query_embedding) > match_threshold
  ORDER BY similarity DESC
  LIMIT match_count;
END;
$$;


ALTER FUNCTION public.match_documents(query_embedding public.vector, match_threshold double precision, match_count integer) OWNER TO postgres;

--
-- Name: notify_bill_status_change(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.notify_bill_status_change() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
  v_follower RECORD;
BEGIN
  -- Log status history
  INSERT INTO public.bill_status_history (bill_id, old_status, new_status)
  VALUES (NEW.id, OLD.status, NEW.status);

  -- Only notify if status actually changed
  IF OLD.status IS DISTINCT FROM NEW.status THEN
    FOR v_follower IN
      SELECT user_id FROM public.bill_follows WHERE bill_id = NEW.id
    LOOP
      -- create_notification is defined in 20260131_user_notifications.sql
      PERFORM public.create_notification(
        v_follower.user_id,
        'bill_update',
        NEW.id,
        NULL,
        'Bill Movement: ' || NEW.title,
        'Status changed from ' || COALESCE(OLD.status, 'Initial') || ' to ' || NEW.status || '.',
        '/bill/' || NEW.id,
        NULL,
        'high',
        jsonb_build_object('old_status', OLD.status, 'new_status', NEW.status)
      );
    END LOOP;
  END IF;

  RETURN NEW;
END;
$$;


ALTER FUNCTION public.notify_bill_status_change() OWNER TO postgres;

--
-- Name: notify_chat_mention(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.notify_chat_mention() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
    v_message record;
    v_actor record;
BEGIN
    -- Get the message details
    SELECT cm.*, cr.name as room_name
    INTO v_message
    FROM public.chat_messages cm
    LEFT JOIN public.chat_rooms cr ON cm.room_id = cr.id
    WHERE cm.id = NEW.message_id;
    
    -- Get actor details
    SELECT full_name, avatar_url INTO v_actor
    FROM public.profiles
    WHERE id = v_message.user_id;
    
    -- Create notification for mentioned user
    PERFORM public.create_notification(
        NEW.mentioned_user_id,
        'chat_mention',
        NEW.message_id,
        v_message.user_id,
        COALESCE(v_actor.full_name, 'Someone') || ' mentioned you',
        LEFT(v_message.content, 100),
        '/community?room=' || v_message.room_id,
        v_actor.avatar_url,
        'high'
    );
    
    RETURN NEW;
END;
$$;


ALTER FUNCTION public.notify_chat_mention() OWNER TO postgres;

