-- Name: notify_moderation_action(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.notify_moderation_action() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    -- Create notification for the moderated user
    PERFORM public.create_notification(
        NEW.target_user_id,
        'moderation',
        NEW.id,
        NEW.moderator_id,
        CASE NEW.action_type
            WHEN 'ban' THEN 'You have been banned'
            WHEN 'mute' THEN 'You have been muted'
            WHEN 'warn' THEN 'You received a warning'
            ELSE 'Moderation action taken'
        END,
        NEW.reason,
        '/community',
        NULL,
        'high'
    );
    RETURN NEW;
END;
$$;


