--

CREATE FUNCTION public.update_bill_follow_count() RETURNS trigger
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
  IF TG_OP = 'INSERT' THEN
    UPDATE public.bills SET follow_count = follow_count + 1 WHERE id = NEW.bill_id;
    RETURN NEW;
  ELSIF TG_OP = 'DELETE' THEN
    UPDATE public.bills SET follow_count = GREATEST(follow_count - 1, 0) WHERE id = OLD.bill_id;
    RETURN OLD;
  END IF;
  RETURN NULL;
END;
$$;


