--
-- Name: admin_intelligence_summary; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.admin_intelligence_summary AS
 SELECT ( SELECT count(*) AS count
           FROM public.profiles) AS total_users,
    ( SELECT count(*) AS count
           FROM public.bills) AS total_bills,
    ( SELECT count(*) AS count
           FROM public.user_notifications
          WHERE (user_notifications.is_read = false)) AS pending_alerts,
    ( SELECT count(*) AS count
           FROM public.profiles
          WHERE ((COALESCE((profiles.preferences ->> 'high_contrast'::text), 'false'::text))::boolean = true)) AS accessibility_adopters,
    ( SELECT count(*) AS count
           FROM public.chat_messages
          WHERE (chat_messages.created_at > (now() - '24:00:00'::interval))) AS chat_activity_24h;


ALTER VIEW public.admin_intelligence_summary OWNER TO postgres;

