--
-- Name: bill_intelligence_heatmap; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.bill_intelligence_heatmap AS
 SELECT b.id,
    b.title,
    b.category,
    b.views_count,
    ( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) AS follow_count,
    (b.views_count + (( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) * 10)) AS intensity_score
   FROM public.bills b
  ORDER BY (b.views_count + (( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) * 10)) DESC;


