--
-- Name: trending_bills; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.trending_bills AS
 SELECT b.id,
    b.title,
    b.summary,
    b.status,
    b.category,
    b.date,
    b.created_at,
    b.updated_at,
    b.url,
    b.sponsor,
    b.description,
    b.stages,
    b.comments,
    b.constitutional_section,
    b.sources,
    b.text_content,
    b.neural_summary,
    b.analysis_status,
    b.pdf_url,
    b.views_count,
    b.vault_id,
    b.vault_metadata,
    b.follow_count,
    b.fts,
    ( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) AS computed_follow_count,
    b.views_count AS view_intensity,
    ((( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) * 5) + COALESCE(b.views_count, 0)) AS trending_score
   FROM public.bills b
  ORDER BY ((( SELECT count(*) AS count
           FROM public.bill_follows f
          WHERE (f.bill_id = b.id)) * 5) + COALESCE(b.views_count, 0)) DESC;


