COPY public.blog_posts (id, title, slug, content, excerpt, author, tags, status, published_at, created_at, updated_at, scheduled_at, rejection_reason, admin_notes, user_id, category_id, media_status, views, views_count) FROM stdin;
b8e38ab5-02f7-4367-99ad-b0ae28826d04	Partners in Blood: The Unholy Alliance Between Power and Violence	partners-in-blood	You could smell the teargas still lingering, needing masks to avoid the worst of it in Nairobi's morning air, but at State House, they wore different masks. On an unusually quiet June morning, before Kenya's police officers at a contrastingly celebratory breakfast, President William Ruto stood, solemnly reaffirming to the shining uniforms: The government of Kenya will support and stand by you!.  He lauded their sacrifices as essential to national security  Without peace and security, we dont have a nation, he said.  This pledge of unwavering backing came at a tense moment: families were calling for answers after police killed or gravely injured dozens of demonstrators (and even a popular blogger) during recent protests.  On the same day, Interior CS Kipchumba Murkomen - in a clip which has since received heavy dissent internationally - gave shoot-to-kill, on-sight orders to the police force on rioters. His recent backtracking  not necessarily a result of a change in stance, but on realisation of the public outrage threatening the regimes image  is something of a pattern that is eerily not hidden any more.\n\nSuch public displays  leaders praising or defending officers amid allegations of brutality  raise a familiar question: Why do those in power rally around the very forces accused of repression?  Across history and continents, authoritarian figures have demonstrated the same reflex: the minute guns and batons are turned inward toward protesters, the president praises the police and army.  To understand this, we must examine both Kenyas unfolding drama and the broader playbook of tyrants.\n\n\nThe Psychology of Manufactured Loyalty\n\nThe relationship between dictators and their security apparatus is built on a foundational lie: that they are partners in service to the nation. In reality, both parties understand the transactional nature of their bond. Violence is used to coerce or repress all opposition to the dictator's rule, and the strength of a dictatorship depends on its use of violence, frequently exercised through military and police institutions.\n\nIn Kenya's case, President Ruto and Interior CS Kipchumba Murkomen publicized a shared mission to protect the nation. Ruto praised the police for enabling Kenyan families "to sleep peacefully each night" and urged citizens to honor law enforcers. Murkomen, in turn, declared that officers had acted under "immense pressure," triumphantly stating after nationwide youth protests: "You [police] have my full support, 100% there is no police officer who committed any excesses yesterday."\n\nBut the record tells a different story. Media and rights groups filmed police shooting into crowds, beating passersby, and even abducting civilians.  Within hours at least 16 people were confirmed killed and over 400 injured during protests over tax hikes and a slain Swahili teacher and publisher of a piece that sought accountability over corrupt millions pointing fingers directly at the Deputy IG's office as the crime scene. Families of the fallen report that police removed name tags and wore masksclear violations of law that belie the regime's public narrative of professional conduct.\n\nIn Parliament and on TV, opposition MPs and NGOs cried foul and demanded accountability.  But the governments response was not an inquiry  it was a staunch defense of its forces.\n\nMany Kenyans found Rutos tone tone-deaf, given that families were still burying loved ones.  In effect, by promising full backing, the president insured that officers believed he had their back  a clear signal that long-term prosecution or reform was merely a suggestion & thus unlikely.\n\nThe lavish commendations serve multiple strategic purposes, each more calculating than the last. They create a psychological bond that transcends mere employment, transforming enforcers into willing accomplices. They establish a shared mythology where the regime's survival becomes synonymous with the forces' own legitimacy and purpose. Most crucially, they create a buffer zone of moral responsibility.\n\nAuthoritarian regimes often resort to coup-proofing measures, including strategically placing family, ethnic, and religious groups in the military and developing multiple internal security agencies with overlapping jurisdiction. But beyond these structural safeguards lies a more insidious tool: the weaponization of praise itself.\n\nThis psychological manipulation serves to absolve individual officers and soldiers of personal responsibility. They aren't participating in state terror; they're fulfilling a noble duty as recognized by their supreme leader. The praise becomes a moral shield, allowing individuals to compartmentalize their actions and maintain their self-image as honorable servants of the state.\n\n\nThe Mechanics of Plausible Deniability\n\nPerhaps nowhere is this dynamic more clearly visible than during periods of civil unrest. When protesters fill the streets, when opposition voices grow too loud, when the regime's grip loosens even slightly, the dictator doesn't issue direct orders for violence. Instead, they speak of maintaining order, protecting citizens, preserving stability.\n\nThe genius of this approach lies in its plausible deniability. When international observers document human rights abuses, when families bury their dead, when the world demands accountability, the dictator can point to their public statements. "I praised our forces for their restraint," they claim. "Any violence was unauthorized, regrettable, the action of individuals who exceeded their mandate."\n\nRuto's government exemplifies this perfectly. After police killed dozens of protesters, officials simultaneously praised the force's "professionalism" while promising to investigate "rogue officers." The praise becomes retrospective cover, a preemptive defense against future accusations. CS Murkomen's case a clear recent example.\n\nSecret police organizations protect the political power of a dictator or regime and often operate outside the law to repress dissidents and weaken political opposition, frequently using violence. Yet publicly, these same organizations are celebrated as guardians of national security, protectors against terrorism, defenders of law and order.\n\nTo many Kenyans, these episodes echo darker chapters of the past.  Under previous administrations, Interior ministries (for example under Fred Matiangi or Joseph Nkaissery) similarly touted the police as Kenyas shield while critics decried their crackdown on dissent & enforced disappearances of rigid spines; the Chris Msando's and Jacob Juma's of their times, and in such regimes, such lists only grow longer. It is a consistent observable pattern that Kenyas security chiefs have long seen themselves as 'loyal guardians of the regime' rather than servants of the people.  This fraught history means todays scenes  of leaders lauding riot police while streets run red  feel depressingly familiar to older generations.\n\n\nDictator 101: GRWM as I Confuse The Public To Keep Me In Power\n\nKenyas example is extreme, but not unique. Political scientists note that personalist or military regimes rely on their security forces to survive.  As one analysis puts it, a dictators power depends on maintaining the approval of the military through concessions and appeasement while simultaneously using that force to crush opposition.  In practice, this means publicly rewarding loyalty and placating the armed to avert any mutiny.  In fact, many autocrats build parallel security branches or "special units" (sounds familiar already?) that answer only to the president  a way of hedging against the regular army and police.  In Kenyas context, while no separate praetorian guard has (yet) broken off, the message is clear: the regime will coddle the existing units and signal that any officer who obeys orders will be protected, even if those orders mean beating or shooting civilians.\n\nWhy do rulers do this?  Some core reasons recur in studies of dictatorships:\n\n1. Ensuring Loyalty:  The greatest fear for any authoritarian is a coup.  By championing the police and military as heroes, leaders bind them by honor and self-interest.  Officers who are publicly praised (and perhaps rewarded behind the scenes) feel personally invested in the regimes survival.  As long as *the boss has their back*, they are less tempted to turn on him.  Kenyas Ruto repeatedly saying We must ensure our officers  are secure is an example of this appeasement.\n\n2. Scapegoating Dissenters:  Deflecting blame is another motive.  Branding protesters as terrorists, anarchists, or agents of a coup  as CS Murkomen did  frames any crackdown as a duty, not a crime.  In that narrative, 'it is the opposition/opposing protestors that unleashed violence, looting and rape', and the police who bravely defended order.  This reversal is common: any atrocity by security forces is justified as fighting a "worse enemy".  This keeps the spotlight on *imaginary villains*, rather than on official brutality.\n\n3. Propaganda of Security:  Praising the forces also serves as propaganda.  By repeatedly calling soldiers and police the defenders of the nation, regimes saturate public discourse with imagery of armed forces as guardians, not oppressors.  For instance, the Syrian press in 2011 quoted Bashar al-Assad praising his army as proving its loyalty to its people and a model of commitment to the nations causes  immediately after troops massacred about 100 civilians during the uprising.  The effect is to create a martyr-hero narrative around the uniform: every axe/rifle becomes a symbol of patriotism. In Kenya, Rutos statement that police keep our families, our property, and the country safe plays into this same story.\n\n4. Mutually Assured Impunity:  When leaders vouch for security forces, they essentially promise... impunity. Yes! An officer who knows the president will defend him is free to act with impunity as deep as the order is high - even on a hapless soul just selling masks. \nThis cycle becomes self-reinforcing, abuses soar, and then leaders double down by declaring their stand by those officers no matter what.  Often they may even publicly commit not to prosecute officers for actions taken in good faith, further immunizing the force. This guarantees short-term stability (no hesitation in enforcing orders), at the long-term cost of blood on the streets and the regimes legitimacy.\n\nTaken together, these tactics explain the pattern we see in Kenya  and elsewhere.  By loudly celebrating the police and portraying them as noble, the regime signals that "police loyalty is its bedrock". If an officer meets a civilian with the barrel of a gun, he need not fear punishment from above.  Instead he hears from the top: Well done! Sikoberurin Kiptayat! This removes one of the key restraints by the Constitution on force by the police - you guessed it - force!  As one anonymous rights advocate quipped of Kenyas situation, If the government endorses deadly force as a first resort, it sets a dangerous precedent....  Indeed, it creates a perverse cycle: more force is used, more political pressure builds, and the government responds by even stronger public assurances to its enforcers. We all know what follows... ask K. Barasa.\n\n\nThe Global Playbook: From Nairobi to Damascus\n\nThis pattern isn't confined to Kenya or any single ideology. The playbook remains remarkably consistent across continents and decades.\n\nSyria's Bloody Theater: \nWhen protesters first rose up in 2011, President Bashar al-Assad publicly lauded the army for "foiling the enemies of the country" immediately after security forces killed over a hundred civilians. State media praised troops as defenders of "the nation's causes and rights," casting the slaughter as victory over "blood merchants" and seditionists. Assad's words transformed massacre into martyrdom, celebrating violent repression as loyalty to the people.\n\nEgypt's Inverted Revolution: \nFive years after the Arab Spring, a striking transformation occurred in Egypt's streets. Instead of marking the revolution anniversary, unfamiliar crowds were celebrating the police. One Cairo protester explained they came "to celebrate the Egyptian police who sacrificed their lives and blood for us." The chants flipped: "Continue Mr. President", replacing calls for regime change. January 25th - the date of the 2011 revolution - became, for all practical purposes, "Police Day.\n\nRussia's Endorsement of Violence: \nIn 2020, Vladimir Putin lauded Belarusian riot police as "demonstrating fairly reserved behavior" in crushing protests after Lukashenko's rigged election, endorsing violence disguised as order. \n\nThis international dimension is crucial: allied autocrats provide mutual validation for repressive tactics. Each regime adapts the script to local context, but the effect remains the same: while the dictator remains hidden from history's judgment, the uniformed lieutenants bear gratitude that masquerades as trust... and when even such foolproof measures fall through, a desperate attempt might ridicule the public ever so often. Nowhere was this more evident than right here when publicly available reports revealed that theRuto administration had sought to engage international PR firms - such as APO Group and Zawya - to bolster its image internationally. Government spokespeople later confirmed the effort had failed, clarifying that no commercial contracts were finalized, though one firm had been sharing presidential updates pro bono since 2020.\n\n\nThe False Narrative of Mutual Protection\n\nDictators understand that their relationship with security forces is inherently unstable. If an autocratic regime did not create its military, it will struggle to control it. This vulnerability creates a constant need to reinforce loyalty, to remind the forces why their fates are intertwined with the regime's survival.\n\nThe praise serves as a constant reminder of this symbiotic relationship. When dictators elevate military and police leaders, when they speak of shared sacrifice and common purpose, they create a narrative where the forces' legitimacy derives from their association with the regime. Should the regime fall, the narrative suggests, these forces would lose not just their positions but their honor, their purpose, their very identity.\n\nThis creates a powerful incentive for the security apparatus to protect the regime from internal dissent. They become invested in the regime's survival because their own reputations, their own futures, their own moral standing within the manufactured narrative depends on it.\n\nIn Kenya, this dynamic plays out through historical memory. The resonance of colonial and post-colonial struggles makes police parades and rhetoric especially potent. When Ruto appears at police events celebrating the Police Football Club's championship at State House, it evokes images of national tradition and sacrifice, binding the force to his personal leadership rather than constitutional duty.\n\n\nThe High Cost of Complicity\n\nFor officers and soldiers caught within this system, the dictator's praise becomes both blessing and curse. It elevates their status within the regime's hierarchy, provides material benefits, creates a sense of importance and purpose. But it also makes them complicit in the regime's crimes, ties their fate to the dictator's survival, and transforms them from servants of the state into servants of a single individual's ambition.\n\nThe praise creates a psychological prison as effective as any physical constraint. Officers who might otherwise question orders, who might resist participating in repression, find themselves trapped by the very recognition they've received. To refuse orders would be to reject the honor bestowed upon them, to betray the trust of the leader who has publicly celebrated their service. A toxic relationship of gaslighting proportions at a national (and dare we add, international) level.\nKenyan officers, many of whom witnessed compatriots fall to police bullets, are reassured at home but indicted abroad. When Ruto and Murkomen "stood firmly behind the police," they implicitly declared all actions lawful - even those violating Kenya's constitution. A policeman who once wore his badge with pride now must reconcile that pride with orders to shoot unarmed citizens. To refuse means shaming the 'great leader's praise'; to obey means living with blood on his hands, justified by narratives spun in State House. Kuishi ndiyo ufurahishe mtu mmoja... amekufanyia nini wewe polisi ufurahie kwako?\n\nThis transformation of protectors into participants in state violence is particularly pernicious because it destroys the social contract. Citizens who once saw police as guarantors of safety now live in terror. The regime's propaganda campaigns equating stability with law-and-order may convince some to demand "respect and support" for police, but for those on the ground, the memory of gunfire and disappearances runs deep.\n\n\nThe Ultimate Betrayal\n\nPerhaps the most cynical aspect of this dynamic is how quickly it can be reversed when convenient. When international pressure becomes too intense, when specific incidents can no longer be ignored, when scapegoats are needed, the same dictators who heaped praise upon their forces can just as easily sacrifice them.\n\nThe "rogue officers" who "exceeded their authority" become convenient explanations for systematic policies of repression. The praise that once elevated these individuals becomes meaningless when weighed against the regime's survival. Officers who believed they were partners in governance discover they were merely tools to be discarded when their usefulness ended - shoot-to-kill orders notwithstanding!\n\nThe false solidarity that bound them to the regime reveals itself as nothing more than a temporary arrangement of mutual convenience. Zimbabwe's Mnangagwa later denied responsibility for security-force massacres, leaving those officers to face consequences alone. In Kenya, Ruto's rhetoric about protecting citizens from "rogue police" already signals this potential betrayal - framing abuses as individual failures rather than systemic policy. History proves this true; when a man sacrifices his children to save his wife, she inherits not his protection, but a future where she must always look over her shoulder.\n\n\nA Mask for Them, A Whip for You.\n\nThe dictator's praise of security forces also serves international audiences. When foreign governments come together to express concern about human rights violations, when international bodies investigate state violence, the dictator can point to their own public support for the forces as evidence of their commitment to lawful behavior.\n\nThis international dimension is what keeps the taps open (security assistance, military aid, diplomatic lifelines) all flowing steadily to regimes whose very survival depends on them. Allied nations, eager to justify their partnerships, routinely point to the dictators polished public statements as evidence that they are dealing with responsible actors. Meanwhile, those same actors are orchestrating human rights violations - chini ya maji, as we say - quietly, methodically, and with full knowledge of the game theyre playing.\n\nWhen viewed through this lens, the choreography is unmistakable. The timing of the praise, the careful choice of words, the calculated staging of uniforms and flags - its not just a performance for the home audience. Its a carefully scripted appeal to the global community, a theatre of legitimacy meant to reassure the West, the lenders, the arms dealers, and the diplomats that order is intact.\n\nIt is a facade of lies - the dictators favourite mask - worn with pride for those whose validation he craves. This is why the promises of progress and justice are delivered in flawless Queens English at press conferences, while the threats, the warnings, the true language of the regime are spat in local dialects, coated in menace, spoken to the streets in a tone that leaves no doubt: the mask is for them, but the whip is for you.\n\n\nBreaking the Cycle of Impunity\n\nUnderstanding this dynamic is crucial for anyone seeking to challenge authoritarian rule or support democratic transitions. The relationship between dictators and their security forces isn't just about command and control - it's about manufactured loyalty, shared complicity, and mutual protection from accountability.\n\nBreaking this cycle requires more than just removing the dictator. It requires dismantling the entire system of incentives and justifications that bind security forces to authoritarian rule. It requires creating alternative narratives of honor and service that don't depend on the survival of any single regime.\n\nFor Kenyas future, hope rests in building accountability mechanisms strong enough to pierce the dictators shield of plausible deniability. It rests in the courage of families who refuse to bury their dead in silence, who can compel open investigations. It rests in the grit of journalists who must spotlight abuses with the precision of ki-BloodParliament, ki-BBC; methodical, relentless, undeniable. And it rests in our courts, if they can rise to deliver justice that is not swayed by power nor stalled by fear.\n\nBut what a vicious cycle it is, because each fresh condemnation by citizens is met, not with reflection, but with louder, more aggressive vows of support for the police. The more the people cry foul, the more the regime tightens its embrace of the enforcers. It is a brutal echo chamber: we protest the violence, they amplify the praise. We demand accountability, they double down on allegiance. Breaking this pattern will demand more than outrage - it will demand stamina, strategy, and a refusal to be silenced.\n\nCivil society and international allies must insist that security-sector reform and transparent investigations accompany any proclamations of support. Kenya's children of the revolution - those who bore bullets and tear gas - see through the performance speeches. They know that slogans about "preserving our nation" ring hollow when lives are cut short.\n\n\nThe Verdict of History\n\nHistory will not be kind to those who participated in this grand deception. The dictators who used praise as a weapon, the security forces who accepted that praise as justification for their crimes, the international community that allowed itself to be fooled by the theater of false professionalism - all will be judged by the blood on their hands, not the words in their speeches.\nThe families of the disappeared, the survivors of torture, the communities terrorized by state violence - they understand the truth that all the praise in the world cannot obscure. They know that behind every dictator's tribute to their security forces lies a simple, ugly reality: power protecting power, violence shielding violence, and accountability sacrificed on the altar of regime survival.\n\nFrom the Kenyan slum to the Damascus suburb, one finds the same tragic equation: He who wields the gun is the hero; he who begs mercy is the traitor. In Kenya today, the president's vows to protect his police mean officers believe they will never face real consequences. That belief has already led to bloodshed on the streets, and it deepens the rift between state and citizen.\n\n\nConclusion: The Price of Protection\n\nIn the end, the dictator's praise reveals more about their weakness than their strength. It exposes their desperate need to maintain loyalty through manipulation rather than legitimacy. It demonstrates their understanding that their authority rests not on consent but on force, not on law but on fear, not on justice but on the calculated distribution of guilt among those willing to serve their interests.\nThe praise is the tell; the involuntary revelation that gives away the game. When Kenya's leaders toast their troops while citizens bury their dead, they expose the fundamental contradiction of their rule. \n\nLegitimacy cannot flow from the barrel of a gun, no matter how eloquently that gun is praised.\n\nFor those still fighting for justice, the lesson is unmistakable: call out the double talk, demand accountability, and remind the world that power built on force is always fragile. As Kenyas leaders line up to celebrate their enforcers, it is the citizens who must reclaim the narrative. The regime may trumpet its warriors, but its weakness is already on display; leaders like Ruto must flatter the forces because, without them, their legitimacy collapses like wet small biscuits.\n\nStrip away the choreographed performances, the staged bravado, the thunderous pronouncements, and what remains is a weak, shameful coward - hiding behind permeable shells of spectacle and the brood of loud mouths who mistake volume for power.\n\nRaise the Constitution high - it remains our most formidable weapon. It has not failed us. It is yet to fail us. It has pierced before through the walls of impunity meticulously built since the days of Moi. And if we hold firm, it will pierce again - 77 hours from now, 7/7.\n\nWhen the next generation reads the history of this era, they will see not respect but fear behind every coat of praise. They will understand that the true measure of leadership lies not in the loyalty of armed forces, but in the trust of free citizens. Until that trust is earned through justice rather than imposed through violence, the dictator's shield will remain what it has always been: a desperate attempt to smear off the blood on their hands on the uniform of state power.\n\nThis analysis draws from extensive documentation of contemporary Kenyan politics, historical patterns of authoritarian governance, and international case studies of state violence and impunity. The author is a... afande please!	You could smell the teargas still lingering, needing masks to avoid the worst of it in Nairobi's morning air, but at State House, they wore different ...	ANON	{Kenya,Goverment,Dictatorship,Police,Military}	published	2025-07-03 05:20:09.322+00	2025-07-03 02:24:22.852612+00	2025-07-03 02:24:22.852612+00	2025-07-03 19:00:00+00	\N	\N	\N	feb9f553-5e0a-4667-967c-2039a26e82fd	approved	0	0
dbd7f617-6c5a-4a1a-94fd-79f73d316cbd	Why Police Target Nairobis Satellite Towns: The Hidden Blueprint of Repression	why-police-target-nairobis-satellite-towns-the-hidden-blueprint-of-repression	Recent protests in Kenyas capital have seen heavy policing and violence concentrated in Nairobis outlying towns and informal settlements, raising questions about why these areas are repeatedly targeted. On July 7, 2025 (the annual Saba Saba protest day), police set up roadblocks on all major highways into Nairobi and clashed with demonstrators on the citys outskirts. In the town of Kitengela (Kajiado County), youth protesters lit bonfires and blocked the NairobiNamanga Road; armed police responded with tear gas and water cannons, and gunshots were reported, leading to multiple injuries. Similarly, in Kangemi, a Nairobi slum, Reuters reporters saw police firing tear gas and water cannon at crowds and even opening live fire on advancing demonstrators. Local clinics reported gunshot victims in Kangemi, and at least two people later died from their wounds.\n\nProtesters in Nairobis Kangemi suburb (July 7, 2025). Witnesses say police used tear gas and opened fire on crowds in Kangemi, a Nairobi slum.\n\nMeanwhile, police entirely locked down Nairobis central business district, diverting protests to peripheral areas. Demonstrators in many satellite towns faced roadblocks, tear gas, and beatings. For example, the state-funded Kenya National Commission on Human Rights (KNCHR) reported that on July 7 police set up numerous roadblocks into Nairobi, and many citizens were unable to report to work due to the blockade. The KNCHR confirmed 10 protester deaths and 29 injuries nationwide by evening that day. It also noted widespread abuses: officers in plain clothes and unmarked vehicles patrolled in Nairobi, Kajiado and Nakuru, and armed gangs attacked protesters alongside police in Nairobi, Kiambu and Kajiado. (The KNCHR explicitly warned that criminal gangs wielding clubs, machetes, and even bows and arrows were intimidating and assaulting protest crowds.)\n\nThese incidents in July 2025 follow a series of clashes across Nairobis periphery earlier in the year. On June 25, 2025, thousands of youths protested police brutality and economic hardship (and the death of a blogger in custody). That day saw at least 19 people killed and 400+ injured nationwide. Reports indicate outbreaks of violence on Nairobis outskirts as well: police blocked roads around the city and fought small groups of demonstrators in suburbs. For instance, AFP and Reuters correspondents observed running battles and police firing tear gas at crowds in outlying districts of Nairobi, with stone-throwing youths and some cases of looting. Satellite towns such as Ruiru and all major entry roads (Thika Road, Mombasa Road, Ngong Road, Kiambu Road) saw heavy police presence. In Ruiru (Kiambu County), People Daily reported clashes in the Kihunguro area as police fired tear gas at protesters. Media reports show wide coverage of protests outside the CBD: demonstrations and violence were noted in Ruiru, Githurai (Kiambu), and in Rift Valley towns (Eldoret) on June 25. In short, outsiders have borne the brunt of force.\n\nWhy these locations? No, it's not tribal. The answer lies in Kenyas demographic and policing history. Many of the targeted satellite towns (Kitengela, Ngong, Rongai, Kiserian in Kajiado; Githurai, Ruiru in Kiambu; Kayole, Dandora in Nairobi East; Mathare and Kibera slums) have large, predominantly young and economically vulnerable populations. Independent analysts note that these communities were hardest hit by rising costs of living and are home to vocal youth protesters. For example, analysts told Reuters these areas have large presence of youth frustrated with inequality and aware of their strength in numbers. In an interview with Reuters, one Nairobi motorbike taxi driver in a suburb said demonstrators chant Ruto Must Go and wantam (one term). Indeed, these communities supplied many protestors: thats where the numbers come from to fill the demonstrations, one Kenyan activist observed (as quoted by KNCHR).\n\nHistorically, Kenyas police have focused on poor, multi-ethnic urban areas on the periphery. Scholars note that since independence, the police were trained during colonial rule to protect the interests of political and economic elites  to protect the ruling class, in effect  at the expense of the poor majority. As one analysis observes, the police tend to be concentrated in the poor urban informal settlements and slums such as Mathare, Kibera, Kayole, Dandora, Mukuru and Kariobangi, not to defend residents but to pacify and repress them into submission. During past crackdowns, entire slum neighborhoods suffered mass violence. For example, in the 200607 operation against the outlawed Mungiki sect, hundreds of youths in Nairobi slums (Mathare and others) were shot or disappeared by police; one report found over 8,000 people were killed or tortured to death in that campaign. Likewise, many of todays protest heartlands  Mathare, Kayole, Kibera  were sites of earlier police brutality in fights over land, protests and sectarian violence. Amnesty and human rights groups have repeatedly documented patterns of arbitrary arrests, disappearances and extrajudicial killings in these communities.\n\nContemporary data confirm this legacy: according to KNCHRs July report, abuses during the recent protests were ubiquitous in exactly these counties. The Commission found that in Kajiado and Kiambu counties  home to Kitengela, Rongai, Githurai, Ruiru and others  armed gangs worked with police to attack demonstrators. In Nairobis informal settlements (including Kangemi, Mathare, Kibera), police in plain clothes opened fire on unarmed youth. These areas are also socioeconomically diverse: city outskirts like Kitengela or Kajiado town have many working-class families, while inner-city slums like Kibera and Mathare mix low-income and middle-income households. The presence of a strong youth population and growing middle class in these towns is frequently noted as a factor spurring mobilization. Police appear to view the political energy in these hubs as a threat.\n\nCiting facts only, observers conclude that nothing mystical is hidden about these neighborhoods  they have been hubs of civic activity and dissent. University experts and rights monitors see police tactics not as coincidence but as deliberate suppression. Macharia Munene, a Nairobi professor, argues that trying to criminalize these Gen Z protests through force is a futile, retrogressive response. The Kenya National Human Rights Commissions statement underscores a consistent pattern: arbitrary arrests, disappearances and excessive force have repeatedly been documented in these very communities during each unrest. By focusing on these towns, the state effectively cuts off protester mobilization and uses overwhelming force away from the international eye.\n\nIn sum, the targeting of Nairobis satellite towns follows an entrenched pattern. Historically, Kenyas security forces concentrate on poor and ethnically mixed areas on the periphery of power. Many of todays young protesters come from Kitengela, Ngong, Kayole, Githurai, Rongai, Kiserian, Kajiado and similar places, so the police have made those communities the frontline of response. Human rights reports confirm that in 2025 the police deployed massively in these counties, often flouting court orders by using unmarked and plain-clothed units. The result has been a brutal cycle: each crackdown in the slums and towns fuels more anger among the same populations. The facts suggest the states strategy is to isolate Nairobis CBD and quash unrest in its high-density, mixed-ethnic outskirts  a strategy rooted in decades of policing Kenyas disenfranchised majority.\n\nSources: Contemporary news reports and human-rights statements document the July 2025 protests and police actions in Nairobis outlying areas. Historical analyses and rights-monitoring groups detail long-running patterns of policing in these communities.	Recent protests in Kenyas capital have seen heavy policing and violence concentrated in Nairobis outlying towns and informal settlements, raising qu...	\N	{"Saba Saba",Police,Nairobi,Dictatorship}	published	2025-07-08 01:13:07.897+00	2025-07-08 01:13:07.898+00	2025-07-08 01:13:07.898+00	\N	\N	\N	\N	feb9f553-5e0a-4667-967c-2039a26e82fd	approved	0	0
0ed0a8be-4ce4-49f0-9954-3d91e64e8fa3	The Death of Albert Ojwang: When Speaking Truth Becomes a Death Sentence	the-death-of-albert-ojwang	I woke up on Sunday, June 9th, to the news that would haunt me for days. Albert Ojwang was dead. A 31-year-old Kiswahili and Religious Studies teacher from Homa Bay. A social media influencer. A Kenyan like me, whose only crime was having an opinion online.\n\nAs I write this, my hands are shaking - not from anger, though there's plenty of that - but from the bone-deep fear that has settled into every young Kenyan who dares to speak their mind. Albert's death is not just a tragedy; it's a warning shot fired across the bow of every citizen who believes in the right to free expression.\n\n\nWhat We Know: The Facts That Chill the Soul\n\nThe timeline is sickeningly clear. On Friday, June 6, 2025, Albert was arrested by DCI officers in Homa Bay following a defamation complaint by Deputy Inspector General Eliud Lagat over social media posts. He was taken from Kakot, Homa Bay, and transported nearly 350 kilometres to Nairobi, where he was held at Central Police Station.\n\nLet me pause here. They dragged this teacher 350 kilometers away from his home, away from his family, away from anyone who could help him. Why Nairobi? Why so far from home for a simple "defamation" case?\n\nHe died the following day, reportedly from head injuries. Less than 48 hours. From arrest to death in less than 48 hours.\n\nPolice claimed he inflicted the injuries by hitting a wall inside his cell. They want us to believe that a teacher, a man whose profession is to educate and nurture young minds, suddenly became so violent that he beat himself to death against a concrete wall.\n\n\nThe Official Narrative: A Story No One Believes\n\nAccording to police, the social media influencer was arrested for publishing false information. Police said the suspect injured himself after hitting his head on the cell wall before he was rushed to Mbagathi Hospital, where he was pronounced dead on arrival.\n\nLet me spell out what they're asking us to believe: Albert, a teacher with everything to live for, decided to commit suicide by repeatedly banging his head against a wall. In a police cell. After being arrested for a social media post.\n\nThe Kenya National Commission on Human Rights (KNCHR) has raised alarm over the death, condemning what it termed as a "premature police narrative" suggesting that Ojwang died from self-inflicted injuries. Even our human rights institutions are calling this narrative premature and suspicious.\n\n\nWhat Should Have Happened: The Rule of Law We Were Promised\n\nIn a functioning democracy, here's what should have happened:\n\n1. Proportionate Response: A social media post, even if defamatory, should have warranted a summons, not a dramatic arrest operation spanning two counties.\n\n2. Legal Representation: Leaked audio clips reveal Ojwang was anxious about his safety in custody, and his lawyer was denied access to speak with the DCI officers. Every citizen has the right to legal counsel, especially when detained.\n\n3. Due Process: Albert should have been charged formally, allowed to make his case in court, and if found guilty, faced appropriate legal consequencesnot death.\n\n4. Proximity to Home: There was no justification for transporting him 350 kilometers away from his support system for a minor offense.\n\n5. Basic Human Safety: Above all, the police had a duty to ensure his safety while in their custody.\n\n\nWhat Likely Happened: Reading Between the Blood-Stained Lines\n\nI don't want to speculate recklessly, but the evidence speaks volumes. Albert was anxious about his safety in custodyhis own words captured in audio clips suggest he feared for his life. This wasn't paranoia; this was prescience.\n\nInspector General Douglas Kanja revealed that Deputy Inspector General Eliud Kipkoech Lagat is the complainant behind the arrest. When a Deputy Inspector General of Police files a personal complaint against a citizen, the entire machinery of state power comes down on that individual. This wasn't just law enforcement; this was an abuse of power.\n\nThe distance - 350 kilometers from home - was deliberate. It isolated Albert from his support network, made it harder for family and lawyers to reach him, and created the perfect conditions for whatever happened in that cell.\n\nInspector-General Douglas Kanja announced that several officers stationed at the Central Police Station during Ojwang's detention had been interdicted. Why interdict officers if this was truly a case of self-harm? What are they trying to hide?\n\n\nThe Heart of Darkness: What This Means for Young Kenyans\n\nI am tired. We are all tired. Tired of living in a country where speaking your mind can get you killed. Tired of watching our friends, our colleagues, our fellow citizens disappear into the machinery of state violence and emerge as corpses with implausible explanations.\n\nAlbert Ojwang was not just a teacher; he was us. He was every young Kenyan who has ever felt frustrated with the system, who has ever posted a critical comment about those in power, who has ever believed that this country could be better. His death is a message to all of us: "Stay quiet, or else."\n\nThis is not the Kenya we were promised. This is not the Kenya our freedom fighters died for. This is not the Kenya enshrined in our Constitution. This is a Kenya where dissent is met with death, where the powerful crush the powerless, where the badge and uniform have become instruments of terror rather than protection.\n\n\nThe Ripple Effect: A Generation Living in Fear\n\nEvery time I open social media now, I think twice before posting. Every critical comment, every shared article, every expression of frustration with the system  they all carry the weight of Albert's death. We are living in an atmosphere of fear, and that fear is killing our democracy slowly, post by post, voice by voice.\n\nThe Law Society of Kenya President Faith Odhiambo said what they had observed so far pointed to foul play. When lawyers are calling it foul play, when human rights organizations are raising alarms, when civil society is up in arms - yes, even when 5 pathologists come together to agree against the official standings of the Government, we know something is fundamentally broken.\n\nAs Amnesty Kenya stated: "No Kenyan should lose their life in police custody, and those entrusted with their protection". Those we entrusted to pull us out of the pits dug by those before & among them have failed us. But it's more than failure  it's betrayal.\n\n\nThe Way Forward: Justice for Albert, Hope for Kenya\n\nAlbert's death cannot be in vain. We demand:\n\n1. A Transparent Investigation: Not an internal police investigation, but an independent, transparent process that the public can trust.\n\n2. Accountability: Everyone involved in Albert's death, from the officers who arrested him to those who failed to protect him in custody, must face justice.\n\n3. Systemic Reform: We need fundamental changes in how our police operate, how they handle dissent, and how they protect citizens in their custody.\n\n4. Protection of Rights: The right to free expression, the right to criticize government, the right to live  these are not negotiable.\n\nAs I finish writing this, protests are building around Nairobi. Protestors have blocked City Mortuary Roundabout as Albert Ojwang's autopsy proceeds. Young Kenyans are taking to the streets because we refuse to let this death be swept under the carpet of official lies and bureaucratic indifference under the suspect regime of President Ruto.\n\nAlbert Ojwang was 31 years old. He was a teacher. He had dreams, hopes, a family who loved him. He posted something online that offended a powerful person, and now he's dead. If that doesn't terrify you about the state of our democracy, I don't know what will.\n\nWe are not just mourning Albert; we are mourning the Kenya we thought we were building. But from this grief, from this anger, from this despair, we must forge something stronger. We must ensure that Albert's voice, silenced in that cell, echoes louder than ever in our demand for justice.\n\nRest in power, Albert Ojwang. Your death will not be forgotten. Your voice will not be silenced.\n\n\n\n*The author is a young Kenyan citizen writing under a pseudonym for obvious reasons. In a country where teachers die for social media posts, anonymity has become a survival strategy.*	A young Kenyan's reflection on how a teacher's social media post led to his mysterious death in police custody	ANON	{}	published	2025-07-01 11:31:28.404+00	2025-06-09 23:33:05+00	2025-06-09 23:33:06+00	\N	\N	\N	\N	feb9f553-5e0a-4667-967c-2039a26e82fd	approved	0	0
