20250609103213	{"\n-- Enable Row Level Security (RLS) on public tables\nALTER TABLE public.blog_posts ENABLE ROW LEVEL SECURITY;\nALTER TABLE public.user_roles ENABLE ROW LEVEL SECURITY;\n\n-- Create RLS policies for blog_posts\nCREATE POLICY \\"Anyone can view published blog posts\\" ON public.blog_posts\n  FOR SELECT USING (status = 'published');\n\nCREATE POLICY \\"Authenticated users can view all blog posts\\" ON public.blog_posts\n  FOR SELECT TO authenticated USING (true);\n\nCREATE POLICY \\"Authenticated users can insert blog posts\\" ON public.blog_posts\n  FOR INSERT TO authenticated WITH CHECK (true);\n\nCREATE POLICY \\"Authenticated users can update blog posts\\" ON public.blog_posts\n  FOR UPDATE TO authenticated USING (true);\n\nCREATE POLICY \\"Authenticated users can delete blog posts\\" ON public.blog_posts\n  FOR DELETE TO authenticated USING (true);\n\n-- Create RLS policies for user_roles\nCREATE POLICY \\"Users can view their own roles\\" ON public.user_roles\n  FOR SELECT USING (user_id = auth.uid());\n\nCREATE POLICY \\"Service role can manage all user roles\\" ON public.user_roles\n  FOR ALL TO service_role USING (true);\n\n-- Fix function search_path security by setting it to immutable for all functions\nALTER FUNCTION public.filter_resources_by_topic(text) SET search_path = '';\nALTER FUNCTION public.get_all_providers() SET search_path = '';\nALTER FUNCTION public.get_discussion_thread(uuid) SET search_path = '';\nALTER FUNCTION public.get_followed_bills(uuid) SET search_path = '';\nALTER FUNCTION public.get_my_volunteer_applications(uuid) SET search_path = '';\nALTER FUNCTION public.get_upcoming_events() SET search_path = '';\nALTER FUNCTION public.get_user_profile(uuid) SET search_path = '';\nALTER FUNCTION public.apply_for_volunteer_opportunity(uuid, uuid, text) SET search_path = '';\nALTER FUNCTION public.create_discussion(uuid, uuid, text, text) SET search_path = '';\nALTER FUNCTION public.submit_contribution(uuid, text, text) SET search_path = '';\nALTER FUNCTION public.submit_feedback(uuid, text, text) SET search_path = '';\nALTER FUNCTION public.unfollow_bill(uuid, uuid) SET search_path = '';\nALTER FUNCTION public.update_updated_at_timestamp() SET search_path = '';\nALTER FUNCTION public.create_event(text, text, date, time, time, text) SET search_path = '';\nALTER FUNCTION public.delete_user_profile(uuid, boolean) SET search_path = '';\nALTER FUNCTION public.get_advocacy_toolkit() SET search_path = '';\nALTER FUNCTION public.follow_bill(uuid, uuid) SET search_path = '';\nALTER FUNCTION public.get_all_learning_materials() SET search_path = '';\nALTER FUNCTION public.get_bill_details(uuid) SET search_path = '';\nALTER FUNCTION public.handle_new_user() SET search_path = '';\nALTER FUNCTION public.list_open_volunteer_opportunities() SET search_path = '';\nALTER FUNCTION public.notify_users_about_bill_change(uuid) SET search_path = '';\nALTER FUNCTION public.search_bills(text) SET search_path = '';\nALTER FUNCTION public.register_user_for_event(uuid, uuid) SET search_path = '';\nALTER FUNCTION public.reply_to_discussion(uuid, uuid, text) SET search_path = '';\nALTER FUNCTION public.search_providers_by_county_or_topic(text, text) SET search_path = '';\nALTER FUNCTION public.update_user_profile(uuid, text, text, text) SET search_path = '';\n"}	c325c1b5-0759-4cfd-90e5-1fabeaf3c461	civiceducationkenya@gmail.com	\N	\N
20250612121331	{"\n-- First, let's update the blog_posts table to support better draft/published management\nALTER TABLE blog_posts ADD COLUMN IF NOT EXISTS scheduled_at TIMESTAMP WITH TIME ZONE;\nALTER TABLE blog_posts ADD COLUMN IF NOT EXISTS rejection_reason TEXT;\nALTER TABLE blog_posts ADD COLUMN IF NOT EXISTS admin_notes TEXT;\n\n-- Enable RLS on blog_posts if not already enabled\nALTER TABLE blog_posts ENABLE ROW LEVEL SECURITY;\n\n-- Drop existing policies to recreate them properly\nDROP POLICY IF EXISTS \\"Anyone can view published blog posts\\" ON blog_posts;\nDROP POLICY IF EXISTS \\"Authenticated users can create drafts\\" ON blog_posts;\nDROP POLICY IF EXISTS \\"Users can view their own drafts\\" ON blog_posts;\nDROP POLICY IF EXISTS \\"Admin can view all posts\\" ON blog_posts;\nDROP POLICY IF EXISTS \\"Admin can update any post\\" ON blog_posts;\n\n-- Create policies for blog posts\n-- Allow everyone to read published posts\nCREATE POLICY \\"Anyone can view published blog posts\\" ON blog_posts\nFOR SELECT USING (status = 'published');\n\n-- Allow authenticated users to create draft posts\nCREATE POLICY \\"Authenticated users can create drafts\\" ON blog_posts\nFOR INSERT WITH CHECK (auth.uid() IS NOT NULL AND status = 'draft');\n\n-- Allow users to view their own drafts\nCREATE POLICY \\"Users can view their own drafts\\" ON blog_posts\nFOR SELECT USING (auth.uid() IS NOT NULL AND status = 'draft');\n\n-- Allow admin to view all posts\nCREATE POLICY \\"Admin can view all posts\\" ON blog_posts\nFOR SELECT USING (\n  EXISTS (\n    SELECT 1 FROM profiles \n    WHERE profiles.id = auth.uid() \n    AND profiles.email = 'civiceducationkenya@gmail.com'\n  )\n);\n\n-- Allow admin to update any post\nCREATE POLICY \\"Admin can update any post\\" ON blog_posts\nFOR UPDATE USING (\n  EXISTS (\n    SELECT 1 FROM profiles \n    WHERE profiles.id = auth.uid() \n    AND profiles.email = 'civiceducationkenya@gmail.com'\n  )\n);\n\n-- Create admin notifications table\nCREATE TABLE IF NOT EXISTS admin_notifications (\n  id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n  type TEXT NOT NULL,\n  title TEXT NOT NULL,\n  message TEXT NOT NULL,\n  related_id UUID,\n  is_read BOOLEAN DEFAULT FALSE,\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT now()\n);\n\n-- Enable RLS on admin notifications\nALTER TABLE admin_notifications ENABLE ROW LEVEL SECURITY;\n\n-- Allow admin to view all notifications\nCREATE POLICY \\"Admin can view notifications\\" ON admin_notifications\nFOR SELECT USING (\n  EXISTS (\n    SELECT 1 FROM profiles \n    WHERE profiles.id = auth.uid() \n    AND profiles.email = 'civiceducationkenya@gmail.com'\n  )\n);\n\n-- Allow admin to update notifications\nCREATE POLICY \\"Admin can update notifications\\" ON admin_notifications\nFOR UPDATE USING (\n  EXISTS (\n    SELECT 1 FROM profiles \n    WHERE profiles.id = auth.uid() \n    AND profiles.email = 'civiceducationkenya@gmail.com'\n  )\n);\n\n-- Insert all bills information for The Finance Bill, 2025\nINSERT INTO bills (\n  id,\n  title,\n  summary,\n  description,\n  status,\n  category,\n  sponsor,\n  constitutional_section,\n  stages,\n  comments,\n  url\n) VALUES (\n  '8feb617a-660e-40fa-915c-a4715c630027',\n  'Finance Bill, 2025',\n  'Proposes amendments to expand the tax net; targeting digital and informal sectors, removing several tax incentives, tightening compliance measures, and giving KRA more administrative authority',\n  'The Finance Bill seeks to reform Kenya''s tax system by expanding the tax base to include digital services and informal sector businesses. It addresses challenges in revenue collection, particularly in emerging economic sectors. The bill proposes increased compliance measures, modernization of tax collection systems, and implementation of digital tax frameworks. It also establishes measures to enhance accountability in tax administration and ensure equitable distribution of tax burden across all economic sectors.',\n  'First Reading',\n  'Finance',\n  'Hon. John Mbadi',\n  'Article 210 - Taxation',\n  '[\n    {\n      \\"name\\": \\"Introduction\\",\n      \\"date\\": \\"2025-02-15\\",\n      \\"completed\\": true,\n      \\"description\\": \\"The bill was introduced to Parliament by Hon. John Mbadi.\\"\n    },\n    {\n      \\"name\\": \\"First Reading\\",\n      \\"date\\": \\"2025-03-20\\",\n      \\"completed\\": true,\n      \\"description\\": \\"The bill was formally introduced in Parliament, its title was read, and copies were distributed to members.\\"\n    },\n    {\n      \\"name\\": \\"Public Feedback\\",\n      \\"date\\": \\"2025-04-25\\",\n      \\"completed\\": false,\n      \\"description\\": \\"The bill is open for public comments and stakeholder input.\\"\n    },\n    {\n      \\"name\\": \\"Committee Review\\",\n      \\"date\\": \\"2025-05-20\\",\n      \\"completed\\": false,\n      \\"description\\": \\"Detailed examination of the bill by the Finance and National Planning Committee.\\"\n    },\n    {\n      \\"name\\": \\"Second Reading\\",\n      \\"date\\": \\"Pending\\",\n      \\"completed\\": false,\n      \\"description\\": \\"Debate on the bill''s general principles and content.\\"\n    },\n    {\n      \\"name\\": \\"Committee Stage\\",\n      \\"date\\": \\"Pending\\",\n      \\"completed\\": false,\n      \\"description\\": \\"Detailed examination and potential amendments.\\"\n    },\n    {\n      \\"name\\": \\"Third Reading\\",\n      \\"date\\": \\"Pending\\",\n      \\"completed\\": false,\n      \\"description\\": \\"Final review and vote on the bill.\\"\n    },\n    {\n      \\"name\\": \\"Presidential Assent\\",\n      \\"date\\": \\"Pending\\",\n      \\"completed\\": false,\n      \\"description\\": \\"The President signs the bill into law or returns it to Parliament.\\"\n    }\n  ]'::jsonb,\n  '[\n    {\n      \\"user\\": \\"Kenya Association of Manufacturers\\",\n      \\"date\\": \\"2025-03-22\\",\n      \\"content\\": \\"We appreciate the government''s efforts to broaden the tax base, but we urge careful consideration of the impact on manufacturing sector competitiveness.\\"\n    },\n    {\n      \\"user\\": \\"Digital Economy Working Group\\",\n      \\"date\\": \\"2025-03-25\\",\n      \\"content\\": \\"The digital tax provisions are progressive, but implementation timelines should consider the readiness of digital platforms and SMEs.\\"\n    },\n    {\n      \\"user\\": \\"Kenya Private Sector Alliance\\",\n      \\"date\\": \\"2025-03-28\\",\n      \\"content\\": \\"While we support tax reforms, the removal of certain incentives may adversely affect investment climate and job creation.\\"\n    }\n  ]'::jsonb,\n  '/legislative-tracker/8feb617a-660e-40fa-915c-a4715c630027'\n) ON CONFLICT (id) DO UPDATE SET\n  title = EXCLUDED.title,\n  summary = EXCLUDED.summary,\n  description = EXCLUDED.description,\n  status = EXCLUDED.status,\n  category = EXCLUDED.category,\n  sponsor = EXCLUDED.sponsor,\n  constitutional_section = EXCLUDED.constitutional_section,\n  stages = EXCLUDED.stages,\n  comments = EXCLUDED.comments,\n  url = EXCLUDED.url;\n\n-- Function to create admin notification\nCREATE OR REPLACE FUNCTION create_admin_notification()\nRETURNS TRIGGER AS $$\nBEGIN\n  IF NEW.status = 'draft' AND (OLD IS NULL OR OLD.status != 'draft') THEN\n    INSERT INTO admin_notifications (type, title, message, related_id)\n    VALUES (\n      'blog_draft',\n      'New Blog Post Draft',\n      'A new blog post draft \\"' || NEW.title || '\\" has been submitted for review.',\n      NEW.id\n    );\n  END IF;\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Create trigger for blog post notifications\nDROP TRIGGER IF EXISTS blog_post_notification_trigger ON blog_posts;\nCREATE TRIGGER blog_post_notification_trigger\n  AFTER INSERT OR UPDATE ON blog_posts\n  FOR EACH ROW\n  EXECUTE FUNCTION create_admin_notification();\n\n-- Function to check if user is admin\nCREATE OR REPLACE FUNCTION is_admin(user_id UUID)\nRETURNS BOOLEAN AS $$\nBEGIN\n  RETURN EXISTS (\n    SELECT 1 FROM profiles \n    WHERE id = user_id \n    AND email = 'civiceducationkenya@gmail.com'\n  );\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n"}	cf38cd13-8e29-454a-816e-c7aff0400dfc	civiceducationkenya@gmail.com	\N	\N
20250612011328	{"\n-- Fix search_path for create_admin_notification function\nCREATE OR REPLACE FUNCTION public.create_admin_notification()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public, pg_temp\nAS $function$\nBEGIN\n  IF NEW.status = 'draft' AND (OLD IS NULL OR OLD.status != 'draft') THEN\n    INSERT INTO admin_notifications (type, title, message, related_id)\n    VALUES (\n      'blog_draft',\n      'New Blog Post Draft',\n      'A new blog post draft \\"' || NEW.title || '\\" has been submitted for review.',\n      NEW.id\n    );\n  END IF;\n  RETURN NEW;\nEND;\n$function$;\n\n-- Fix search_path for is_admin function\nCREATE OR REPLACE FUNCTION public.is_admin(user_id uuid)\nRETURNS boolean\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public, pg_temp\nAS $function$\nBEGIN\n  RETURN EXISTS (\n    SELECT 1 FROM profiles \n    WHERE id = user_id \n    AND email = 'civiceducationkenya@gmail.com'\n  );\nEND;\n$function$;\n\n-- Fix search_path for get_resource_view_count function\nCREATE OR REPLACE FUNCTION public.get_resource_view_count(p_resource_id text, p_resource_type text)\nRETURNS integer\nLANGUAGE sql\nSTABLE \nSECURITY DEFINER\nSET search_path = public, pg_temp\nAS $function$\n  SELECT COUNT(*)::INTEGER\n  FROM resource_views\n  WHERE resource_id = p_resource_id \n    AND resource_type = p_resource_type;\n$function$;\n\n-- Fix search_path for track_resource_view function\nCREATE OR REPLACE FUNCTION public.track_resource_view(p_resource_id text, p_resource_type text, p_view_type text DEFAULT 'page_view'::text, p_user_id uuid DEFAULT NULL::uuid, p_ip_address inet DEFAULT NULL::inet, p_user_agent text DEFAULT NULL::text)\nRETURNS uuid\nLANGUAGE sql\nSECURITY DEFINER\nSET search_path = public, pg_temp\nAS $function$\n  INSERT INTO resource_views (\n    resource_id,\n    resource_type,\n    view_type,\n    user_id,\n    ip_address,\n    user_agent,\n    viewed_at\n  ) VALUES (\n    p_resource_id,\n    p_resource_type,\n    p_view_type,\n    COALESCE(p_user_id, auth.uid()),\n    p_ip_address,\n    p_user_agent,\n    now()\n  )\n  RETURNING id;\n$function$;\n"}	2b155bc0-0272-4bed-8147-fa10f1fae60e	civiceducationkenya@gmail.com	\N	\N
20250809111403	{"\n-- Add missing columns to profiles table for community join functionality\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS county text;\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS bio text;\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS interests jsonb;\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS areas_of_interest jsonb;\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS created_via text DEFAULT 'direct_signup';\nALTER TABLE profiles ADD COLUMN IF NOT EXISTS auth_user_id uuid;\n\n-- Create indexes for better resource filtering performance\nCREATE INDEX IF NOT EXISTS idx_resources_category ON resources (lower(category));\nCREATE INDEX IF NOT EXISTS idx_resources_type ON resources (lower(type));\nCREATE INDEX IF NOT EXISTS idx_resources_created_at ON resources (created_at);\n\n-- Add status column to volunteer_opportunities if not exists\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS status text DEFAULT 'open';\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS skills_required jsonb;\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS contact_email text;\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS apply_url text;\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS is_remote boolean DEFAULT false;\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS tags jsonb;\nALTER TABLE volunteer_opportunities ADD COLUMN IF NOT EXISTS created_by_user_id uuid;\n\n-- Create RLS policies for volunteer opportunities submission\nCREATE POLICY \\"Anyone can submit volunteer opportunities\\" ON volunteer_opportunities\nFOR INSERT WITH CHECK (true);\n\nCREATE POLICY \\"Authenticated users can update their own volunteer opportunities\\" ON volunteer_opportunities\nFOR UPDATE USING (auth.uid() = created_by_user_id);\n\n-- Function to create non-auth community profiles\nCREATE OR REPLACE FUNCTION create_community_profile(\n  p_full_name text,\n  p_email text DEFAULT NULL,\n  p_county text DEFAULT NULL,\n  p_bio text DEFAULT NULL,\n  p_interests jsonb DEFAULT NULL,\n  p_areas_of_interest jsonb DEFAULT NULL\n) RETURNS uuid\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nDECLARE\n  v_profile_id uuid;\nBEGIN\n  v_profile_id := gen_random_uuid();\n  \n  INSERT INTO profiles (\n    id,\n    full_name,\n    email,\n    county,\n    bio,\n    interests,\n    areas_of_interest,\n    created_via\n  ) VALUES (\n    v_profile_id,\n    p_full_name,\n    p_email,\n    p_county,\n    p_bio,\n    p_interests,\n    p_areas_of_interest,\n    'join-community'\n  );\n  \n  RETURN v_profile_id;\nEND;\n$$;\n\n-- Function to link community profile to authenticated user\nCREATE OR REPLACE FUNCTION link_community_profile(\n  p_profile_id uuid,\n  p_auth_user_id uuid\n) RETURNS void\nLANGUAGE plpgsql\nSECURITY DEFINER\nAS $$\nBEGIN\n  UPDATE profiles \n  SET auth_user_id = p_auth_user_id,\n      id = p_auth_user_id,\n      updated_at = now()\n  WHERE id = p_profile_id;\nEND;\n$$;\n"}		civiceducationkenya@gmail.com	\N	\N
20250827121834	{"\n-- Add comprehensive resource data to the resources table\nINSERT INTO public.resources (id, title, description, type, url, category, is_downloadable, created_at, updated_at, \\"uploadedBy\\", \\"downloadUrl\\", \\"videoUrl\\", thumbnail_url, user_id)\nVALUES\n('00000000-0000-0000-0000-000000000001','IEBC Voter Education Curriculum','Official voter education curriculum prepared by IEBC for continuous voter education.','document','https://www.iebc.or.ke/uploads/resources/oqwLzhwU42.pdf','Voter Education',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','IEBC','https://www.iebc.or.ke/uploads/resources/oqwLzhwU42.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000002','IEBC Voter Education Training Manual','Training manual for facilitators running voter education sessions (IEBC).','document','https://www.iebc.or.ke/uploads/resources/pdQMe3WKeV.pdf','Voter Education',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','IEBC','https://www.iebc.or.ke/uploads/resources/pdQMe3WKeV.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000003','IEBC FAQs on electoral processes','IEBC Frequently Asked Questions on registration, voting and elections.','document','https://iebc.or.ke/uploads/resources/gV62Lv1JdT.pdf','Elections',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','IEBC','https://iebc.or.ke/uploads/resources/gV62Lv1JdT.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000004','The National Civic Education Framework (Kenya)','Government of Kenya framework to coordinate civic education across sectors and counties.','document','https://devolution.go.ke/sites/default/files/2024-11/THE%20NATIONAL%20CIVIC%20EDUCATION%20FRAMEWORK%20762024.pdf','Civic Education',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Ministry of Devolution','https://devolution.go.ke/sites/default/files/2024-11/THE%20NATIONAL%20CIVIC%20EDUCATION%20FRAMEWORK%20762024.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000005','Kenya National Commission on Human Rights - State of Human Rights Report','KNCHR State of Human Rights report covering recent period (includes civic space sections).','document','https://www.knchr.org/Portals/0/KNCHR%20State%20of%20Human%20Rights%20Report%20%20JULY%202023-NOVEMBER%202024.pdf','Human Rights',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','KNCHR','https://www.knchr.org/Portals/0/KNCHR%20State%20of%20Human%20Rights%20Report%20%20JULY%202023-NOVEMBER%202024.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000006','Kitocha Katiba - Educational Centre resources','Civic education courses, guides and publications from Kitocha Katiba (constitutional development).','document','https://www.kituochakatiba.org/programmes/educational-centre','Civic Education',false,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Kitocha Katiba',NULL,NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000007','Katiba Institute - Handbook on the Access to Information Act','Practical handbook on Kenya''s Access to Information law (Katiba Institute).','document','https://katibainstitute.org/wp-content/uploads/2023/09/Katiba-Institute-Handbook-on-the-Access-to.pdf','Rights/Access to Information',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Katiba Institute','https://katibainstitute.org/wp-content/uploads/2023/09/Katiba-Institute-Handbook-on-the-Access-to.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000008','Transparency International Kenya - Annual/Research Reports','TI-Kenya research on corruption and civic engagement (reports and toolkits).','document','https://tikenya.org/','Anti-Corruption',false,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Transparency International Kenya',NULL,NULL,NULL,NULL),\n('00000000-0000-0000-0000-000000000009','UNDP Civic Education Toolkit (regional)','Toolkit for civic education and youth engagement (UNDP regional resources).','document','https://www.undp.org/south-africa/publications/toolkit-civic-education-youth','Civic Education/Youth',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','UNDP','https://www.undp.org/south-africa/publications/toolkit-civic-education-youth',NULL,NULL,NULL),\n('00000000-0000-0000-0000-00000000000A','CIVICUS: Civic Education Toolkit','CIVICUS toolkit on civic education approaches and methodologies.','document','https://www.civicus.org/documents/toolkits/PGX_B_Civic%20Education.pdf','Civic Education',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','CIVICUS','https://www.civicus.org/documents/toolkits/PGX_B_Civic%20Education.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-00000000000B','BBC Africa Eye - Blood Parliament Documentary (Pt 1)','Documentary examining state response to youth protest in Kenya (video).','video','https://youtu.be/qz0f1yyf_eA','Governance/Documentary',false,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','BBC Africa Eye',NULL,'https://youtu.be/qz0f1yyf_eA','https://i.ytimg.com/vi/qz0f1yyf_eA/maxresdefault.jpg',NULL),\n('00000000-0000-0000-0000-00000000000C','Voter Rights Infographic - Example','Infographic explaining voter rights and responsibilities (example file).','infographic','https://example.org/voter-rights-infographic.pdf','Voter Education',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Civic Education Team','https://example.org/voter-rights-infographic.pdf',NULL,'https://example.org/voter-rights-thumb.jpg',NULL),\n('00000000-0000-0000-0000-00000000000D','Understanding the Constitution of Kenya','A comprehensive guide to the Constitution of Kenya 2010, covering fundamental rights, government structure, and key provisions.','document','https://cajrvemigxghnfmyopiy.supabase.co/storage/v1/object/public/resources/The_Constitution_of_Kenya_2010.pdf','Constitution',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','CEKA Admin','https://cajrvemigxghnfmyopiy.supabase.co/storage/v1/object/public/resources/The_Constitution_of_Kenya_2010.pdf',NULL,NULL,NULL),\n('00000000-0000-0000-0000-00000000000E','Your Rights as a Kenyan Citizen','Visual representation of fundamental rights guaranteed by the Constitution.','infographic','/assets/rights-infographic.png','Rights',true,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Civic Education Kenya','/assets/rights-infographic.png',NULL,'/assets/rights-thumbnail.jpg',NULL),\n('00000000-0000-0000-0000-00000000000F','Kenya Law - Bills listing and legislative resources','Repository of bills, laws and legislative notices useful for civic education on law-making.','document','https://new.kenyalaw.org/bills/','Legislation',false,'2023-01-01T00:00:00+00:00','2025-08-10T00:00:00+00:00','Kenya Law',NULL,NULL,NULL,NULL);\n\n-- Add indexes for performance\nCREATE INDEX IF NOT EXISTS idx_resources_type ON public.resources(type);\nCREATE INDEX IF NOT EXISTS idx_resources_category ON public.resources(category);\nCREATE INDEX IF NOT EXISTS idx_resources_created_at ON public.resources(created_at);\nCREATE INDEX IF NOT EXISTS idx_resources_is_downloadable ON public.resources(is_downloadable);\nCREATE INDEX IF NOT EXISTS idx_resources_search ON public.resources USING gin(to_tsvector('english', title || ' ' || description));\n"}		civiceducationkenya@gmail.com	\N	\N
20250829052456	{"-- Add missing geo_json_url column to visualizers table\nALTER TABLE public.visualizers \nADD COLUMN IF NOT EXISTS geo_json_url TEXT;\n\n-- Create RLS policy for visualizers if not exists\nDO $$ \nBEGIN\n    IF NOT EXISTS (\n        SELECT 1 FROM pg_policies \n        WHERE tablename = 'visualizers' \n        AND policyname = 'Visualizers are viewable by everyone'\n    ) THEN\n        CREATE POLICY \\"Visualizers are viewable by everyone\\" \n        ON public.visualizers \n        FOR SELECT \n        USING (is_active = true);\n    END IF;\nEND $$;"}		civiceducationkenya@gmail.com	\N	\N
20250829052617	{"-- Add RLS policies for tables that are missing them\nCREATE POLICY \\"Public can read blog categories\\" \nON public.blog_categories \nFOR SELECT \nUSING (true);\n\nCREATE POLICY \\"Public can read resource categories\\" \nON public.resource_categories \nFOR SELECT \nUSING (true);\n\nCREATE POLICY \\"Public can read carousel slides\\" \nON public.carousel_slides \nFOR SELECT \nUSING (is_active = true);\n\n-- Fix function search paths to address security warnings\n-- The following functions need search_path fixes but already have some set\n-- We'll recreate them with proper search paths\n\n-- Fix the functions that have mutable search paths\nCREATE OR REPLACE FUNCTION public.update_discussion_reply_count()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public', 'pg_temp'\nAS $function$\nBEGIN\nIF TG_OP = 'INSERT' THEN\nUPDATE discussions SET replies = replies + 1 WHERE id = NEW.discussion_id;\nRETURN NEW;\nELSIF TG_OP = 'DELETE' THEN\nUPDATE discussions SET replies = replies - 1 WHERE id = OLD.discussion_id;\nRETURN OLD;\nEND IF;\nRETURN NULL;\nEND;\n$function$;\n\nCREATE OR REPLACE FUNCTION public.update_updated_at_column()\nRETURNS trigger\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path TO 'public', 'pg_temp'\nAS $function$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$function$;"}		civiceducationkenya@gmail.com	\N	\N
20250910105723	{"-- Create the community_members table for Join Community form submissions\nCREATE TABLE IF NOT EXISTS public.community_members (\n  id UUID DEFAULT gen_random_uuid() PRIMARY KEY,\n  first_name TEXT NOT NULL CHECK (char_length(first_name) >= 1 AND char_length(first_name) <= 100),\n  last_name TEXT NOT NULL CHECK (char_length(last_name) >= 1 AND char_length(last_name) <= 100),\n  email TEXT NOT NULL CHECK (char_length(email) >= 5 AND char_length(email) <= 255),\n  county TEXT CHECK (char_length(county) <= 100),\n  interests TEXT CHECK (char_length(interests) <= 2000),\n  areas_of_interest TEXT[] DEFAULT '{}',\n  terms_accepted BOOLEAN NOT NULL DEFAULT FALSE,\n  source_ip TEXT,\n  user_agent TEXT,\n  status TEXT DEFAULT 'pending' CHECK (status IN ('pending', 'processed', 'email_failed')),\n  created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n  updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\n);\n\n-- Create indexes for better performance\nCREATE INDEX IF NOT EXISTS idx_community_members_email ON public.community_members(email);\nCREATE INDEX IF NOT EXISTS idx_community_members_created_at ON public.community_members(created_at);\nCREATE INDEX IF NOT EXISTS idx_community_members_status ON public.community_members(status);\n\n-- Enable RLS\nALTER TABLE public.community_members ENABLE ROW LEVEL SECURITY;\n\n-- Create policies for secure access\nCREATE POLICY \\"Allow authenticated users to insert community applications\\" \nON public.community_members \nFOR INSERT \nWITH CHECK (auth.uid() IS NOT NULL);\n\nCREATE POLICY \\"Allow authenticated users to view their own applications\\" \nON public.community_members \nFOR SELECT \nUSING (auth.uid() IS NOT NULL);\n\n-- Admin can manage all community member applications\nCREATE POLICY \\"Admins can manage community applications\\" \nON public.community_members \nFOR ALL \nUSING (\n  EXISTS (\n    SELECT 1 FROM profiles \n    WHERE profiles.id = auth.uid() \n    AND profiles.email = 'civiceducationkenya@gmail.com'\n  )\n);\n\n-- Add trigger for updating updated_at timestamp\nCREATE OR REPLACE FUNCTION update_community_members_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = NOW();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\nCREATE TRIGGER trigger_community_members_updated_at\n  BEFORE UPDATE ON public.community_members\n  FOR EACH ROW\n  EXECUTE FUNCTION update_community_members_updated_at();"}		civiceducationkenya@gmail.com	\N	\N
20250914021531	{"-- Ensure the trigger function exists for processing_jobs\nCREATE OR REPLACE FUNCTION public.update_processing_jobs_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Drop existing trigger if it exists\nDROP TRIGGER IF EXISTS update_processing_jobs_updated_at ON public.processing_jobs;\n\n-- Create the trigger for processing_jobs\nCREATE TRIGGER update_processing_jobs_updated_at\n    BEFORE UPDATE ON public.processing_jobs\n    FOR EACH ROW\n    EXECUTE FUNCTION public.update_processing_jobs_updated_at();\n\n-- Enable RLS on processing_jobs\nALTER TABLE public.processing_jobs ENABLE ROW LEVEL SECURITY;\n\n-- Drop existing policies if they exist\nDROP POLICY IF EXISTS \\"processing_jobs_insert_authenticated\\" ON public.processing_jobs;\nDROP POLICY IF EXISTS \\"processing_jobs_insert_anon\\" ON public.processing_jobs;\nDROP POLICY IF EXISTS \\"processing_jobs_select_owner\\" ON public.processing_jobs;\nDROP POLICY IF EXISTS \\"processing_jobs_update_owner\\" ON public.processing_jobs;\nDROP POLICY IF EXISTS \\"processing_jobs_delete_owner\\" ON public.processing_jobs;\nDROP POLICY IF EXISTS \\"service_role_manage_processing_jobs\\" ON public.processing_jobs;\n\n-- Authenticated users: insert only when user_id = auth.uid()\nCREATE POLICY \\"processing_jobs_insert_authenticated\\" ON public.processing_jobs\n    FOR INSERT TO authenticated\n    WITH CHECK ((user_id IS NOT NULL AND user_id = auth.uid()));\n\n-- Anonymous users: allow insert only if user_id IS NULL\nCREATE POLICY \\"processing_jobs_insert_anon\\" ON public.processing_jobs\n    FOR INSERT TO anon\n    WITH CHECK (user_id IS NULL);\n\n-- Authenticated users: select their own jobs\nCREATE POLICY \\"processing_jobs_select_owner\\" ON public.processing_jobs\n    FOR SELECT TO authenticated\n    USING (user_id = auth.uid());\n\n-- Authenticated users: update their own jobs\nCREATE POLICY \\"processing_jobs_update_owner\\" ON public.processing_jobs\n    FOR UPDATE TO authenticated\n    USING (user_id = auth.uid())\n    WITH CHECK (user_id = auth.uid());\n\n-- Authenticated users: delete their own jobs (optional)\nCREATE POLICY \\"processing_jobs_delete_owner\\" ON public.processing_jobs\n    FOR DELETE TO authenticated\n    USING (user_id = auth.uid());\n\n-- Service role can manage all jobs (bypass RLS)\nCREATE POLICY \\"service_role_manage_processing_jobs\\" ON public.processing_jobs\n    FOR ALL TO service_role\n    USING (true)\n    WITH CHECK (true);\n\n-- Anonymous users can view jobs without user_id (public jobs)\nCREATE POLICY \\"processing_jobs_select_public\\" ON public.processing_jobs\n    FOR SELECT TO anon\n    USING (user_id IS NULL);"}		civiceducationkenya@gmail.com	\N	\N
20260125154759	{"-- Create chat_messages table for community chat\nCREATE TABLE public.chat_messages (\n  id UUID NOT NULL DEFAULT gen_random_uuid() PRIMARY KEY,\n  user_id UUID NOT NULL,\n  room_id TEXT NOT NULL DEFAULT 'general',\n  content TEXT NOT NULL,\n  created_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(),\n  updated_at TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now()\n);\n\n-- Create index for fast room-based queries\nCREATE INDEX idx_chat_messages_room_created ON public.chat_messages(room_id, created_at DESC);\nCREATE INDEX idx_chat_messages_user ON public.chat_messages(user_id);\n\n-- Enable RLS\nALTER TABLE public.chat_messages ENABLE ROW LEVEL SECURITY;\n\n-- Anyone authenticated can read chat messages\nCREATE POLICY \\"Authenticated users can read chat messages\\"\n  ON public.chat_messages\n  FOR SELECT\n  USING (auth.uid() IS NOT NULL);\n\n-- Users can insert their own messages\nCREATE POLICY \\"Users can send chat messages\\"\n  ON public.chat_messages\n  FOR INSERT\n  WITH CHECK (auth.uid() = user_id);\n\n-- Users can update their own messages\nCREATE POLICY \\"Users can update their own messages\\"\n  ON public.chat_messages\n  FOR UPDATE\n  USING (auth.uid() = user_id);\n\n-- Users can delete their own messages\nCREATE POLICY \\"Users can delete their own messages\\"\n  ON public.chat_messages\n  FOR DELETE\n  USING (auth.uid() = user_id);\n\n-- Enable Realtime for chat_messages\nALTER PUBLICATION supabase_realtime ADD TABLE public.chat_messages;\n\n-- Create trigger for updated_at\nCREATE TRIGGER update_chat_messages_updated_at\n  BEFORE UPDATE ON public.chat_messages\n  FOR EACH ROW\n  EXECUTE FUNCTION public.update_updated_at_column();"}		civiceducationkenya@gmail.com	\N	\N
20260126015009	{"-- SECURE ADMIN ROLE SYSTEM - Using existing text-based role column\n\n-- 1. Add unique constraint to user_roles if not exists\nALTER TABLE public.user_roles DROP CONSTRAINT IF EXISTS user_roles_user_id_role_key;\nALTER TABLE public.user_roles ADD CONSTRAINT user_roles_user_id_role_key UNIQUE (user_id, role);\n\n-- 2. Create security definer function to check roles (avoids infinite recursion)\nCREATE OR REPLACE FUNCTION public.has_admin_role(_user_id uuid)\nRETURNS boolean\nLANGUAGE sql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\n  SELECT EXISTS (\n    SELECT 1\n    FROM public.user_roles\n    WHERE user_id = _user_id\n      AND role = 'admin'\n  )\n$$;\n\n-- 3. Create function to check if user is admin via roles table (for RPC calls)\nCREATE OR REPLACE FUNCTION public.check_user_is_admin()\nRETURNS boolean\nLANGUAGE plpgsql\nSTABLE\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  RETURN EXISTS (\n    SELECT 1 FROM public.user_roles\n    WHERE user_id = auth.uid() AND role = 'admin'\n  );\nEND;\n$$;\n\n-- 4. Drop existing policies if they exist and recreate\nDROP POLICY IF EXISTS \\"Users can view their own roles\\" ON public.user_roles;\nDROP POLICY IF EXISTS \\"Admins can view all roles\\" ON public.user_roles;\nDROP POLICY IF EXISTS \\"Admins can manage roles\\" ON public.user_roles;\nDROP POLICY IF EXISTS \\"Admins can insert roles\\" ON public.user_roles;\nDROP POLICY IF EXISTS \\"Admins can update roles\\" ON public.user_roles;\nDROP POLICY IF EXISTS \\"Admins can delete roles\\" ON public.user_roles;\n\n-- 5. Enable RLS\nALTER TABLE public.user_roles ENABLE ROW LEVEL SECURITY;\n\n-- 6. RLS Policies for user_roles\nCREATE POLICY \\"Users can view their own roles\\"\nON public.user_roles FOR SELECT\nTO authenticated\nUSING (auth.uid() = user_id);\n\nCREATE POLICY \\"Admins can view all roles\\"\nON public.user_roles FOR SELECT\nTO authenticated\nUSING (public.has_admin_role(auth.uid()));\n\nCREATE POLICY \\"Admins can insert roles\\"\nON public.user_roles FOR INSERT\nTO authenticated\nWITH CHECK (public.has_admin_role(auth.uid()));\n\nCREATE POLICY \\"Admins can update roles\\"\nON public.user_roles FOR UPDATE\nTO authenticated\nUSING (public.has_admin_role(auth.uid()));\n\nCREATE POLICY \\"Admins can delete roles\\"\nON public.user_roles FOR DELETE\nTO authenticated\nUSING (public.has_admin_role(auth.uid()));\n\n-- 7. Insert the root admin (civiceducationkenya@gmail.com) - using simple insert\nINSERT INTO public.user_roles (user_id, role)\nVALUES ('99a89404-8dd0-4e22-9ee5-30c28295771b', 'admin')\nON CONFLICT (user_id, role) DO NOTHING;\n\n-- 8. Create trigger to auto-assign admin role for root admin on profile creation\nCREATE OR REPLACE FUNCTION public.auto_assign_admin_role()\nRETURNS TRIGGER\nLANGUAGE plpgsql\nSECURITY DEFINER\nSET search_path = public\nAS $$\nBEGIN\n  IF NEW.email = 'civiceducationkenya@gmail.com' THEN\n    INSERT INTO public.user_roles (user_id, role)\n    VALUES (NEW.id, 'admin')\n    ON CONFLICT (user_id, role) DO NOTHING;\n  END IF;\n  RETURN NEW;\nEND;\n$$;\n\nDROP TRIGGER IF EXISTS assign_admin_role_trigger ON public.profiles;\nCREATE TRIGGER assign_admin_role_trigger\nAFTER INSERT ON public.profiles\nFOR EACH ROW\nEXECUTE FUNCTION public.auto_assign_admin_role();\n\n-- 9. Add parent_id column to chat_messages for threading support (if not exists)\nALTER TABLE public.chat_messages \nADD COLUMN IF NOT EXISTS parent_id uuid REFERENCES public.chat_messages(id) ON DELETE CASCADE;\n\n-- 10. Create indexes for chat performance\nCREATE INDEX IF NOT EXISTS idx_chat_messages_parent_id ON public.chat_messages(parent_id);\nCREATE INDEX IF NOT EXISTS idx_chat_messages_room_created ON public.chat_messages(room_id, created_at DESC);"}		civiceducationkenya@gmail.com	\N	\N
